import React from 'react';
import LayoutFour from "../../components/Layout/LayoutFour";
import { Breadcrumb, BreadcrumbItem } from "../../components/Other/Breadcrumb";

const registerUser = () => {
    return (
<LayoutFour title="INICIO" className="-style-1">
<Breadcrumb title="ADMINISTRACIÓN">
<BreadcrumbItem name="ADMINISTRACION" />
<BreadcrumbItem name="REGISTRO DE USUARIOS" current />
</Breadcrumb>

            <style>
                {`
                    .login-page {
                        width: 360px;
                        margin: auto;
                        padding-bottom: 60px;
                    }

                    .login-form input, .login-form select {
                        font-family: "Roboto", sans-serif;
                        outline: 0;
                        background: #f2f2f2;
                        width: 100%;
                        border: 0;
                        margin: 0 0 15px;
                        padding: 15px;
                        box-sizing: border-box;
                        font-size: 14px;
                    }

                    .login-form button {
                        font-family: "Roboto", sans-serif;
                        text-transform: uppercase;
                        outline: 0;
                        background: #f26460;
                        width: 100%;
                        border: 0;
                        padding: 15px;
                        color: #FFFFFF;
                        font-size: 14px;
                        -webkit-transition: all 0.3 ease;
                        transition: all 0.3 ease;
                        cursor: pointer;
                    }

                    .login-form button:hover,.login-form button:active,.login-form button:focus {
                        background: #ee3631;
                    }

                    .login-form label {
                        font-family: "Roboto", sans-serif;
                        font-size: 14px;
                        color: #333;
                        margin-bottom: 5px;
                        display: block;
                    }
                `}
</style>

            <div className="login-page">
<h2>Formulario de Usuarios</h2>
<div className="form">
<form className="login-form">
<div className="form-group">
<label htmlFor="userName">Nombre de Usuario</label>
<input type="text" id="userName" placeholder="Ingrese el Nombre de Usuario" />
</div>
<div className="form-group">
<label htmlFor="password">Contraseña</label>
<input type="password" id="password" placeholder="Ingrese la Contraseña" />
</div>
<div className="form-group">
<label htmlFor="email">Email</label>
<input type="email" id="email" placeholder="Ingrese el Email" />
</div>

                        <button type="submit" className="bold-text">Enviar</button>
</form>
</div>
</div>
</LayoutFour>
    );
};

export default registerUser;
